  \"energy-expenditure-of-moose-on-the-kenai-national-wildlife-refuge-annual-progress-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The objective of this work unit is to measure
  the energy requirements of moose during different seasons and for different sex
  and age classes. Techniques employed will permit partitioning of the energy contained
  in plants into various components down to net energy available for production. This
  information, along with data collected on forage supply and quality in a companion
  study, will be used in a mathematical model which can predict the capacity of the
  Kenai National Moose Range to support moose. This report summarizes the work completed
  prior to May 1981. Results include food intake rates, digestion trials, rumen turnover
  time, seasonal energy expenditure, methane production, simulation modeling, and
  energy partitioning.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
